const EVENTS = [
  { id: 1, name: "Event 1" },
  { id: 2, name: "Event 2" },
  { id: 3, name: "Event 3" },
  { id: 4, name: "Event 4" },
];

const Events = () => {
  return (
    <>
      <h1>Events page</h1>
      <ul>
        {EVENTS.map((event) => (
          <li key={event.id}>{event.name}</li>
        ))}
      </ul>
    </>
  );
};

export default Events;
